const ColoredLine = ({ color }) => (
    <hr
        style={{
            color: color,
            backgroundColor: color,
            width: 322,
        }}
    />
);

export default ColoredLine

function Group(props) {
    return (
        <div className="group-block">
            <img src={props.src} className="group__icon"/>
            <span>{props.name}</span>
        </div>
    );
}
